import { Event } from './EventComponents';

export const Events = () => {

   const response = fetch('https://tdanielsskidmore.github.io/events/test.json')
    .then(response => response.json())
    .then(json => {return json});

    response.then(value => {
        for(var key in value.Events) {
            console.log(key.title)
            }

    })


    return (
        <div className='event'>
            <Event title="Hello" photo='data:image/jpeg;base64,' 
            discription='This is a dog' date="Jan 2"/>
        </div>
    )
}
